import React, { Component } from 'react';
import qrcode from "qrcode";

import './App.scss';
import LinkList from './components/linkList/LinkList.jsx';
import Dictionary from './components/dictionary/Dictionary.jsx';

class App extends Component {
  constructor(props) {
    super(props);
    this.canvasRef = React.createRef();
  }

  componentDidMount(){
    qrcode.toCanvas(this.canvasRef.current, 'https://github.com/yyt6801/Dict')
  }

  render() {
    return (
      <div className="app">
        <div className="content">
          <Dictionary />
          <canvas ref={this.canvasRef}>qrcode</canvas>
          <input type="text" />
          <button>生成</button>
        </div>
        <div className="sidebar">
          <LinkList />
        </div>
      </div>
    );
  }
}

export default App;
